import React from "react";

const Header = ({gold, wood, stone}) => {
  return <div className="hederis">
    <div>GOLD:{gold}</div>
    <div>WOOD:{wood}</div>
    <div>STONE:{stone}</div>
  </div>;
};

export default Header;
